script: |
  super -f text -I q7391.spq | sort > q7391.out

inputs:
  - name: q7391.spq
    data: |
      SELECT DISTINCT - 98 / - col1 + - - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + col0 IN ( - - col0, col2, + col1, + + 97 * - col2 - + col1 );
  - name: tab0

outputs:
  - name: q7391.out
    data: |
